                                                                               'No cambies los horarios de comida. Mantener sus rutinas de alimentación es vital para que la salud de tu mascota no se vea afectada y siga fuerte y sano como siempre.
                                                                               Procura que el estar en casa sea bueno para ambos, mantente cerca y juega con tu mascota para que estén activos aún dentro de casa.
                                                                               Respeta los horarios de siesta de tu mascota (sobre todo si tienes un gato). Ellas tienen sus horarios y espacios de siesta, y es importante respetarlas para no sacar de control a tu mascota.
                                                                               Crea nuevos hábitos dentro de casa. Podrías aprovechar el tiempo con tu mascota para desarrollar nuevas formas de juego, ejercicio o incluso enseñarle nuevos trucos.', 'C', 'a');


Toma una comida u objeto que le guste a tu perro. Después ponlo en alguna de tus manos sin que él pueda ver en cuál está. Coloca tus manos al frente y deja que, con su olfato, intuya dónde está el objeto. Si toca con su pata la mano adecuada, ¡se ganó el premio! Si no, vuelve a intentarlo hasta que adivine. Esta actividad estimulará su inteligencia y lo hará valorar la cosa que más le gusta.

2. Hielos sorpresa

Especialmente durante temporadas de calor, puedes usar tu cubetera de hielos para poner a congelar agua con un snack para perros en su interior. Tu perro tendrá un nuevo pasatiempo lamiendo el hielo hasta llegar al delicioso snack sorpresa.

3. Trae mi gorra

A nuestros compañeros les fascina interactuar con nosotros y hacer tareas sencillas, así que puedes optar por enseñarle una palabra como gorra y, luego, pedirle que te la traiga. Impulsarás su inteligencia, además, se sentirá el dueño del universo, aunque el universo sea sólo nuestra casa.

4. Arriba y abajo

Al estar dentro de casa deberás de sacarle provecho a todos los rincones de tu hogar, así que si cuentas con escaleras úsalas para entretener a tu perro lanzándole uno de sus juguetes hasta el final de las escaleras para que tu mascota vaya por él y regrese subiendo los escalones. Repítanlo una y otra vez para ejercitar a tu perro.

5: Echémonos un chapuzón

Si tienes jardín en tu casa, una idea excelente es colocar una piscina para que tu mejor amigo y tú puedan echarse un chapuzón. ¿Qué mejor manera de entretener a tu perro que nadando y jugando con el agua? Prepara una comida para que ambos disfruten al terminar el juego, ¡le encantará relajarse un poco!

Un consejo es no exceder el tiempo de juego, pues esto podría agotar a tu mascota; sería muy complicado volver a hacer la misma actividad con él si relaciona esos juegos con desanimo, en lugar de diversión. Intenta que todas tus actividades lo llenen de felicidad en lugar de angustiarlo. Y, recuerda, no todos los perritos son iguales, elige las actividades de acuerdo con sus gustos y condición física.

En Purina® creemos que cuando las mascotas y las personas se unen la vida es mejor, y a través de estas acciones podrán fortalecer su relación.

En Purina® sabemos que quieres tener la mejor relación con tu perro para que siempre puedan vivir momentos increíbles. Por eso te invitamos a seguir viendo más de nuestro contenido para que, desde el cariño que tienes por tu mascota, encuentres la información adecuada para educar, alimentar y cuidar a tu gran amigo de la mejor forma durante todo el tiempo que esté a tu lado.', 'C', 'a');








